import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './AccountPage.css';

const AccountPage = () => {
  const [formData, setFormData] = useState({
    firstName: 'John',
    lastName: 'Doe',
    email: 'john@example.com',
    company: 'Tech Corp',
    jobTitle: 'Software Developer',
    industry: 'Information Technology',
    yearsExperience: '5',
    skills: 'React, JavaScript, Node.js',
    linkedinUrl: 'https://linkedin.com/in/johndoe',
    bio: 'Experienced software developer with a passion for building web applications.'
  });
  const [isEditing, setIsEditing] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form data:', formData);
    setIsEditing(false);
  };

  return (
    <div className="account-page">
      {/* Navigation Bar */}
      <nav className="navbar">
        <div className="navbar-container">
          <div className="navbar-brand">YourApp</div>
          <div className="navbar-links">
            <Link to="/" className="nav-link">Home</Link>
            <Link to="/dashboard" className="nav-link">Dashboard</Link>
            <Link to="/account" className="nav-link active">Account</Link>
          </div>
        </div>
      </nav>

      <div className="account-content">
        <div className="account-container">
          <h1>Professional Profile</h1>
          <p>Manage your professional information</p>

          {/* Rest of your existing form code... */}
          <form onSubmit={handleSubmit} className="account-form">
            {/* All your existing form fields */}
          </form>
          
          {/* Rest of your existing content */}
        </div>
      </div>
    </div>
  );
};

export default AccountPage;
